function App() {
  //TODO: Presentar el concepto STATE
  let varprueba = "Titulo"

  const handleChangePrueba = (event) => {
    varprueba = event.target.value
  }


  return (
    <div className="App">
      <h3>Notas</h3>
      <label htmlFor="pruebaID">Input prueba</label>
      <input 
       id="pruebaID" 
       name="prueba" 
       type="text" 
       onChange={handleChangePrueba}
       value={varprueba}/>
    </div>
  );
}

export default App;
